import React from 'react';
import axios from 'axios';
import './App.scss';

function App() {
  var imageData;
  axios.get('https://api.flickr.com/services/rest/?method=flickr.galleries.getPhotos&api_key=2a0b9c81a6daa39ee08fb2c9569a4d64&gallery_id=66911286-72157647277042064&format=json&nojsoncallback=1')
  .then(response => {
    imageData = response.data.photos.photo;

    for (var i = 0, photosLen = imageData.length; i < photosLen; i++) {
      const imageURL = 'https://farm'+ imageData[i].farm +'.staticflickr.com/' + imageData[i].server + '/' + imageData[i].id + '_' + imageData[i].secret + '.jpg';
      console.log(imageURL);
      console.log(imageData);

    }

  })
  .catch(error => {
    console.log(error)
  });



  return (
    <div className="App">
      <header className="App-header">
        <h1>Flickr Photo Stream</h1>

        <ul>
        {
          imageData.map(id => (
            <li key={id}>
            </li>
          ))
        }
      </ul>



      </header>
    </div>
  );
}

export default App;
